import React from 'react';
import './App.css';

function About() {
  return (
    <div>
      <h1>O Nas</h1>
      <p>Jesteśmy sklepem sprzedającym przeróżne rzeczy: od Sprzętu Ogrodowego do Elektroniki.</p>
    </div>
  );
}

export default About;
